// Functions
/*--------------------------------------------------------------------------------------------------------*/

// Initializes DP application -> Called by onload event 
function initVis() {

    createMapChart();
    populateTable();
    createLineCharts();
}


function populateTable() {

    var i;
    var j;
    var s;
    var rows;

    // Creates HTML
    s = '';
    j = ds.length;
    for(i = 0; i < j; i++) {
        s = s + '<tr class="t5w-' + ds[i][10] + ' t5c-' + ds[i][12] + '">' + 
                    '<td><span class="float-sm-left"><strong>' + ds[i][2] + '</strong></span><br><span class="float-sm-left"><em>' + ds[i][1] + '</em></span></td>' +
                    '<td>' + ds[i][7] + '</td>' +
                    '<td>' + ds[i][8] + '</td>' +
                    '<td>' + ds[i][14] + '</td>';
        switch (ds[i][0]) {
            case 'North America':
                s = s + '<td><span class="lbl-' + ds[i][13] + '">' + ds[i][5] + '</span></td><td></td><td></td><td></td><td></td><td></td>';
                break;
            case 'South America':
                s = s + '<td></td><td><span class="lbl-' + ds[i][13] + '">' + ds[i][5] + '</span></td><td></td><td></td><td></td><td></td>';
                break;
            case 'Europe':
                s = s + '<td></td><td></td><td><span class="lbl-' + ds[i][13] + '">' + ds[i][5] + '</span></td><td></td><td></td><td></td>';
                break;
            case 'Africa':
                s = s + '<td></td><td></td><td></td><td><span class="lbl-' + ds[i][13] + '">' + ds[i][5] + '</span></td><td></td><td></td>';
                break;
            case 'Asia':
                s = s + '<td></td><td></td><td></td><td></td><td><span class="lbl-' + ds[i][13] + '">' + ds[i][5] + '</span></td><td></td>';
                break;
            case 'Oceania':
                s = s + '<td></td><td></td><td></td><td></td><td></td><td><span class="lbl-' + ds[i][13] + '">' + ds[i][5] + '</span></td>';
                break;
        }
        s = s + '<td id="lineChart_' + i + '"></td></tr>';
    }

    // Updates table body HTML
    document.getElementById('tbl_body').innerHTML = s;
    
    // Updates background color for field '%Available'
    rows = document.getElementById('tbl_body').rows
    for(i = 0; i < j; i++) {
        rows[i].cells[3].classList.add(sunshineColorClass(ds[i][14], 'class'));
    }
    
    // Shows elements
    toggleVisibility(2);
    document.getElementById('filter2').classList.add('active');
    document.getElementById('tbl').classList.remove('d-none');
}


function sunshineColorClass(sd, type) {

    if(sd <= 20) {
        return type == 'class' ? 'sc1' : '#FFFFB7'; 
    } else if(sd <= 40) {
        return type == 'class' ? 'sc2' : '#FFF192';
    } else if(sd <= 60) {
        return type == 'class' ? 'sc3' : '#FFEA61';
    } else if(sd <= 80) {
        return type == 'class' ? 'sc4' : '#FFDD3C';
    } else {
        return type == 'class' ? 'sc5' : '#FFD400'; 
    }
}


function toggleVisibility(filterId) {

    var i;
    var rows = document.getElementById('tbl_body').rows;
    var j = rows.length;
    for(i = 0; i < j; i++) {
        switch(filterId) {
            case 1:
                rows[i].classList.remove('d-none');
                break;
            case 2:
                if(rows[i].classList.contains('t5w-Rest')) {
                    rows[i].classList.add('d-none');
                } else {
                    rows[i].classList.remove('d-none');
                }           
                break;
            case 3:
                    if(rows[i].classList.contains('t5c-Rest')) {
                        rows[i].classList.add('d-none');
                    } else {
                        rows[i].classList.remove('d-none');
                    }           
                    break;
        }
    }
}


function filter(elem, filterId) {

    toggleVisibility(filterId);
    document.getElementById('filter1').classList.remove('active');
    document.getElementById('filter2').classList.remove('active');
    document.getElementById('filter3').classList.remove('active');
    document.getElementById('filter' + filterId).classList.add('active');
}


function createMapChart() {
    
    var vlSpec = {
        "$schema": "https://vega.github.io/schema/vega-lite/v4.json",
        "actions": false,
        "width": 1000,
        "height": 500,
        "autosize": "none",
        "projection": {"scale": 150},
        "layer": [
            // Layer 0: World Map (background)
            {
                "data": {
                    "url": "https://raw.githubusercontent.com/vega/datalib/master/test/data/world-110m.json",
                    "format": {"type": "topojson", "feature": "countries"},
                    "transform": [{"type": "geopath"}]
                },
                "mark": {
                    "type": "geoshape",
                    "fill": "#383838",
                    "stroke": "lightgray"
                }
            },
            // Layer 1: Points for cities
            {
                "data": {
                    "name": "cities",
                    "values": citiesGeo
                },
                "mark": {"type": "circle"},
                "encoding": {
                    "longitude": {"field": "lon", "type": "quantitative"},
                    "latitude": {"field": "lat", "type": "quantitative"},
                    "size": {"value": 30},
                    "color": {"value": "yellow"},
                    "tooltip": {"field": "City", "type": "nominal"}
                }
            }
        ] 
    };
    vegaEmbed('#mapChart', vlSpec);
}


function createLineCharts() {

    var i;
    var j;
    var m;
    var values;
    var vlSpec;


    // Creates a line chart for each data row
    j = ds.length;
    for(i = 0; i < j; i++) {
        values = [];
        for(m = 0; m < 12; m++) {
            values.push({"Date": "2019 " + (m + 1) + " 1", "Sunshine": ds[i][6][m]});
        }
        vlSpec = {
            "$schema": "https://vega.github.io/schema/vega-lite/v4.json",
            "actions": false,
            "width": 500,
            "height": 80,
            "autosize": "none", 
            "data": {"values": values},
            "mark": {
                "type": "line", 
                "strokeWidth": 1,
                "strokeDash": [4, 4],
                "point": true
            },
            "encoding": {
                "x": {"timeUnit": "month", "field": "Date", "type": "temporal", "axis": {"grid": false}},
                "y": {"field": "Sunshine", "type": "quantitative", "axis": {"grid": false}},
                "tooltip": [
                    {"field": "Date", "type": "temporal", "format": "%b"},
                    {"field": "Sunshine", "type": "quantitative"}
                ],
                "color": {"value": "rgb(219, 95, 13)"}
            }
        }
        vegaEmbed('#lineChart_' + i, vlSpec);
    }
}
